% Get the U-matrices to construct the asymptotic expansion of R explicitly without 
% convolutions. Warning: possible CPU overload when editing. The size of c is used to
% determine the number of U-matrices returned.
% Input
%   alpha, beta  - Parts of the weight w(x) = (1-x).^alpha.*(1+x).^beta.*h(x)
%   Dinf         - Limit of the Szego function
%   c,d          - Coefficients needed for the U-matrices
% Output
%   Uright       - Coefficient matrices for (z-1)^k
%   Uleft        - Coefficient matrices for (z+1)^k
% About
%   Author       - Peter Opsomer (Peter.Opsomer@cs.kuleuven.be)
%   History      - Created January 2014, last edit February 2015
function [Uright,Uleft] = UExplicit(alpha,beta,Dinf,c,d)
Uright = zeros(2,2,2*length(c)+1,length(c)+1);
Uleft = zeros(2,2,2*length(c)+1,length(c)+1);
% About half of this tensor will not be used
Uright(:,:,1,1) = (4*alpha^2-1)/16*[Dinf,0;0,Dinf^(-1)]*[-1,1i; 1i,1]*[Dinf^(-1),0;0,Dinf]; %A1
