    1i*(-8*beta-8*alpha+8*d(0+1)+4*beta^2+4*alpha^2-10);1i*(-8*beta-8*alpha+8*d(0+1)-4*beta^2 ...
    -4*alpha^2+10),-(-8*beta-8*alpha+8*d(0+1)-4*alpha^2+1)]*[Dinf^(-1),0;0,Dinf]; %B2

